import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom"
import './App.css';
import Product from "./Pages/Product/Product";
import Home from "./Pages/Home/Home";
import Products from "./Pages/Prodcuts/Products";

const router= createBrowserRouter([
  {
    path: "/",
    element: <Home/>
  },
  {
    path: "/products/:id",
    element: <Products/>
  },
  {
    path: "/product/:id",
    element: <Product/>
  },
])
function App() {
  return (
    <div className="App">
       <RouterProvider router={router}/>
    </div>
  );
}

export default App;
